
var KalturaNotificationsSettingsService={get:function(){var kparams=new Object();return new KalturaRequestBuilder("notificationssettings","get",kparams);},update:function(settings){var kparams=new Object();kparams.settings=settings;return new KalturaRequestBuilder("notificationssettings","update",kparams);},updateWithToken:function(settings,token,partnerId){var kparams=new Object();kparams.settings=settings;kparams.token=token;kparams.partnerId=partnerId;return new KalturaRequestBuilder("notificationssettings","updateWithToken",kparams);}}